angular.module('LogosMain.controllers', [])

  //The Main Controller is responsible for storing the particulars of
  //the user session, among other things. For this reason main should
  //always sit at the top of the Scope Chain.
  .controller('MainController', function($scope, $state) {
    $scope.storage = {};
    $scope.storage.user = false;
    $scope.storage.loginData = {};

    // The Logos Object is used to generate our image, it consists of
    // two fundamental parameters: a name and a value. Optionally
    // (and this is true for all the Logos on the feed), a Logos may
    // also include a picture of the user.
    $scope.storage.userLogos = {
    };
    //Logomap is a list of RGBA values which, when processed by the d3
    //directive, renders a visualization. It is nothing more than the production
    //of the userLogos, parsed by the server side algorithm. When received from
    //the server, it is an object {logo : [array of values]}. It is stored here
    //in the same format, however make sure to use the processLogoMap helper to get
    //direct access to the array for any method that might want to manipulate it.
    //logoMap can potentially hold multiple maps.
    $scope.storage.logoMap = [];
  })

  //The Feed Controller is responsible for managing the Collection of
  //Logos Controllers on the Public Feed. Among other things, it keeps
  //a record all all the current Logos being displayed.
  .controller('FeedController', function($scope, $state, $http, $timeout, $q, RouterService, UtilityService) {
    $scope.currentLogos = [];
    $scope.getLogos = function() {
      RouterService.getPublicFeed()
      .then(function(value) {
        UtilityService.parseFeed(value)
        .then(function(parsedFeed) {
          angular.forEach(parsedFeed, function(publicLogos) {
            $scope.currentLogos.push(publicLogos);
          });
        });
      });
      $timeout(function() {
        $scope.getLogos();
      }, 45000);
    };
  })

  //The Logos Controller is responsible for rendering our Logos on the
  //page. It is always associated with exactly one Logos at a given moment.
